"  <div id=\"topicText\">",
"   <p class=\"headingAnchor\" id=\"H8525276\">",
"    <span class=\"h1\">",
"     INTRODUCTION",
"    </span>",
"    &nbsp;&mdash;&nbsp;The following material represents a subset of chemotherapy regimens that are used for the treatment of patients with pancreatic cancer, both in the adjuvant setting and for advanced disease.",
"    <strong>",
"     This is",
"    </strong>",
"    <strong>",
"     not an exhaustive list",
"    </strong>",
"    ; it includes regimens that are considered by the authors and editors to be commonly used and important for the care of patients with pancreatic cancer. Additional regimens may be added over time, particularly as treatment for pancreatic cancer evolves.",
"   </p>",
"   <p>",
"    This topic review is intended to provide only a listing of chemotherapy regimens. It does not address the appropriate context for use of these regimens in the care of patients with pancreatic cancer. Clinicians should refer to the individual disease-oriented topic reviews that discuss the use of these protocols in appropriate clinical situations:",
"   </p>",
"   <p>",
"    <ul class=\"bulletCompact-block\">",
"     <li>",
"      (See",
"      <a class=\"medical medical_review\" href=\"mobipreview.htm?38/12/39114?source=see_link\">",
"       \"Chemotherapy for advanced exocrine pancreatic cancer\"",
"      </a>",
"      .)",
"     </li>",
"     <li>",
"      (See",
"      <a class=\"medical medical_review\" href=\"mobipreview.htm?21/33/22042?source=see_link\">",
"       \"Adjuvant and neoadjuvant therapy for exocrine pancreatic cancer\"",
"      </a>",
"      .)",
"     </li>",
"     <li>",
"      (See",
"      <a class=\"medical medical_review\" href=\"mobipreview.htm?32/37/33370?source=see_link\">",
"       \"Management of locally advanced and borderline resectable exocrine pancreatic cancer\"",
"      </a>",
"      .)",
"     </li>",
"    </ul>",
"   </p>",
"   <p>",
"    These tables are provided as examples of how to administer these regimens; there may be other acceptable methods. All chemotherapy regimens must be administered by clinicians who are trained in the use of chemotherapy. The clinician is expected to use his or her independent medical judgment in the context of individual circumstances to make adjustments, as necessary.",
"   </p>",
"   <p class=\"headingAnchor\" id=\"H8525441\">",
"    <span class=\"h1\">",
"     REGIMENS",
"    </span>",
"   </p>",
"   <p class=\"headingAnchor\" id=\"H8525449\">",
"    <span class=\"h2\">",
"     Adjuvant setting",
"    </span>",
"   </p>",
"   <p class=\"headingAnchor\" id=\"H8525474\">",
"    <span class=\"h3\">",
"     Adjuvant gemcitabine",
"    </span>",
"    &nbsp;&mdash;&nbsp;(",
"    <a class=\"graphic graphic_table graphicRef81436 \" href=\"mobipreview.htm?26/2/26669\">",
"     table 1",
"    </a>",
"    )",
"   </p>",
"   <p class=\"headingAnchor\" id=\"H8525513\">",
"    <span class=\"h2\">",
"     Metastatic disease",
"    </span>",
"   </p>",
"   <p class=\"headingAnchor\" id=\"H8525538\">",
"    <span class=\"h3\">",
"     Gemcitabine monotherapy",
"    </span>",
"    &nbsp;&mdash;&nbsp;(",
"    <a class=\"graphic graphic_table graphicRef60330 \" href=\"mobipreview.htm?35/56/36749\">",
"     table 2",
"    </a>",
"    )",
"   </p>",
"   <p class=\"headingAnchor\" id=\"H8525617\">",
"    <span class=\"h3\">",
"     FOLFIRINOX (fluorouracil plus leucovorin, irinotecan, and oxaliplatin)",
"    </span>",
"    &nbsp;&mdash;&nbsp;(",
"    <a class=\"graphic graphic_table graphicRef79571 \" href=\"mobipreview.htm?43/3/44094\">",
"     table 3",
"    </a>",
"    )",
"   </p>",
"   <p class=\"headingAnchor\" id=\"H936511973\">",
"    <span class=\"h3\">",
"     Modified FOLFOX6 (fluorouracil plus leucovorin and oxaliplatin)",
"    </span>",
"    &nbsp;&mdash;&nbsp;(",
"    <a class=\"graphic graphic_table graphicRef50132 \" href=\"mobipreview.htm?16/53/17246\">",
"     table 4",
"    </a>",
"    )",
"   </p>",
