"   <h1>",
"    REFERENCES",
"   </h1>",
"   <ol id=\"reference\">",
"    <li>",
"     <div class=\"reference\">",
"      Centers for Disease Control and Prevention (CDC), \"Guidelines for the Prevention and Treatment of Opportunistic Infections Among HIV-Exposed and HIV-Infected Children,\"",
"      <i>",
"       MMWR Recomm Rep",
"      </i>",
"      , 2009, 58(RR-11):1-166. Available at",
"      <a href=\"file://aidsinfo.nih.gov/contentfiles/Pediatric_OI.pdf%20\" target=\"_blank\">",
"       file://aidsinfo.nih.gov/contentfiles/Pediatric_OI.pdf",
"      </a>",
"      <span class=\"pubmed-id\">",
"       [PubMed",
"       <a href=\"mobipreview.htm?31/42/32419/abstract-text/19730409/pubmed\" id=\"19730409\" target=\"_blank\">",
