var title_f31_42_32420="Pericardial effusion four chamber echocardiogram";
var content_f31_42_32420=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic2\" style=\"width: 1040px;\">",
"  <div class=\"videoplayer\" h264=\"./images/CARD/66715/4chperef_conv.mp4?title=Pericardial+effusion+four+chamber+echocardiogram\" style=\"width:360px;height:272px\">",
"  </div>",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    Pericardial effusion",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 269px; height: 438px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Apical 4 chamber view from a 2-D echocardiogram shows a large pericardial effusion surrounding the heart. The heart has a swinging motion during the cardiac cycle and there is slight compression of the right atrium early in diastole, suggesting early tamponade.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Courtesy of Thomas Binder, MD. University of Vienna.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
