"           <td class=\"subtitle1_single\">",
"            Less than 25 meq/L",
"           </td>",
"          </tr>",
"          <tr>",
"           <td>",
"            Vomiting or nasogastric suction",
"           </td>",
"          </tr>",
"          <tr>",
"           <td>",
"            Diuretics (late)",
"           </td>",
"          </tr>",
"          <tr>",
"           <td>",
"            Factitious diarrhea",
"           </td>",
"          </tr>",
"          <tr>",
"           <td>",
"            Posthypercapnia",
"           </td>",
"          </tr>",
"          <tr>",
"           <td>",
"            Cystic fibrosis",
"           </td>",
"          </tr>",
"          <tr>",
"           <td>",
"            Low chloride intake",
"           </td>",
"          </tr>",
"         </tbody>",
"        </table>",
"       </td>",
"       <td class=\"container\">",
"        <table cellspacing=\"0\">",
"         <tbody>",
"          <tr>",
"           <td class=\"subtitle1_single\">",
"            Greater than 40 meq/L",
"           </td>",
"          </tr>",
"          <tr>",
"           <td>",
"            Primary mineralocorticoid excess",
"           </td>",
"          </tr>",
"          <tr>",
"           <td>",
"            Diuretics (early)",
"           </td>",
"          </tr>",
"          <tr>",
"           <td>",
"            Alkali load (bicarbonate or other organic anion",
"           </td>",
"          </tr>",
"          <tr>",
"           <td>",
"            Bartter's or Gitelman's syndrome",
"           </td>",
"          </tr>",
"          <tr>",
"           <td>",
"            Severe hypokalemia (plasma [K+] &lt; 2.0 meq/L)",
"           </td>",
"          </tr>",
"         </tbody>",
"        </table>",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
