var title_f31_42_32428="Cancer screening in transplant";
var content_f31_42_32428=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=CARD%2F57971&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=5\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=CARD%2F57971&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=5\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Suggested guidelines for cancer screening in patients undergoing solid organ transplantation",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1\">",
"        Cancer type",
"       </td>",
"       <td class=\"subtitle1\">",
"        Recommendation",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Breast",
"       </td>",
"       <td>",
"        Women 50 to 69: annual screening mammography with or without clinical breast examination; age 40 to 49: the benefit of screening is less certain, and should be left to the decision of the physician and patient; &ge;70 years of age: annual screening is appropriate as long as estimated life exectancy is &ge;8 years.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Skin",
"       </td>",
"       <td>",
"        Monthly self examination; physician examination annually, with early referral for suspected lesions.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Cervical",
"       </td>",
"       <td>",
"        All women &ge;18 years old and sexually active girls &lt;18 years old should undergo an annual pelvic examination and PAP smear.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Anogenital",
"       </td>",
"       <td>",
"        Yearly physical examination of the anogenital area, including pelvic examination and cytologic studies for women. Insufficient evidence to recommend for or against screening anoscopy and biopsies of anal epithelium.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        KS/other sarcomas",
"       </td>",
"       <td>",
"        Examination of skin, conjunctivae, and oropharyngeal mucosa annually; patients at higher risk (ethnicity, geographic area of residence or serologic positivity for HHV) may benefit from more frequent screening.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Prostate",
"       </td>",
"       <td>",
"        Annual screening with digital rectal examination and PSA recommended for men &ge;age 50, if their estimated life expectancy is at least 10 years. If positive family history or African American race, may start annual screening earlier (eg, age 45).",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Colorectal",
"       </td>",
"       <td>",
"        Starting at age 50: annual FOBT and either sigmoidoscopy every five years or colonoscopy every 10 years*.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        PTLD",
"       </td>",
"       <td>",
"        Complete history and physical examination every three months, particularly in the first posttransplant year; patients at increased risk of PTLND may benefit from more frequent screening.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Lung",
"       </td>",
"       <td>",
"        Not recommended.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        HCC",
"       </td>",
"       <td>",
"        For patients with chronic hepatitis B or C and cirrhosis, serum AFP and liver ultrasound every 6 to 12 months.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Renal cell",
"       </td>",
"       <td>",
"        Screening via cytologic or radiographic means is not recommended, except possibly for patients with a history of analgesic abuse.",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"     KS: Kaposi's sarcoma; PSA: prostate specific antigen; HHV-8: human herpesvirus 8; FOBT: fecal occult blood testing; PTLD: posttransplant lymphoproliferative disorder; HCC: hepatocellular cancer.",
"     <br>",
"      * At some institutions, screening is started at age 40 or five years after transplant, whichever comes first.",
"     </br>",
"    </div>",
"    <div class=\"reference\">",
"     Modified from: Kasiske BL, et al. J Am Soc Nephrol 2000; 11:S1.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
