var title_f31_42_32429="Self measurement of INR";
var content_f31_42_32429=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=HEME%2F52321&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=HEME%2F52321&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 503px\">",
"   <div class=\"ttl\">",
"    Correlation between self-measured INR and laboratory INR",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 483px; height: 389px; background-image: url(data:image/gif;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    The filled and open symbols represent self-measured and laboratory international normalized ratio (INR) from patients taking phenoprocoumon or acenocoumarol, respectively. The self-measured INR was determined from a capillary blood sample obtained and analyzed at home, while the laboratory-measured INR was determined from a venous blood sample assayed virtually simultaneously. The line of identity is shown in blue.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Data from: Cromheecke ME, Levi M, Colly LP, et al. Oral anticoagulation self-management and management by a specialist anticoagulation clinic: a randomised cross-over comparison. Lancet 2000; 356:97.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
